import Expenses from './components/Expenses';

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    {
      id: "e2",
      title: "New TV",
      amount: 799.12,
      date: new Date(2021, 2, 14),
    },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.12,
      date: new Date(2020, 7, 14),
    },
    {
      id: "e4",
      title: "New Desk",
      amount: 894.12,
      date: new Date(2019, 2, 14),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>   
      <Expenses items={expenses} />
    </div>
  );
}

export default App;
